import React from "react";

export default function NavBar() {
  return (
    <div className="bg-black font-sans">
      <ul className="flex items-center justify-end gap-6 pt-8 pb-8 pr-8 bg-transparent text-3xl text-white">
        <li>Projects</li>
        <li>About</li>
        <li>Skills</li>
        <li>Contact</li>
      </ul>
      <h2 className="text-4xl">Syed Wajahat Ali</h2>
    </div>
  );
}
